import React, { Component } from 'react';
import {Link} from 'react-router-dom';
import './footer.css';
import fb from '../img/facebook.png';
import ph from '../img/phone.jpg';
import email from '../img/email.png';
import whats from '../img/whatsapp.png';

class Footer extends Component {
    state = {  }
    render() { 
        return ( 
            <React.Fragment>
                <footer className="main-footer">
                    <div className="container-fluid">
                        <div className="row">
                            <div className="col-lg-3 col-md-3">
                                <div>
                                    <Link to='/home'>Home</Link>
                                </div>
                                <div>
                                    <Link to='/home'>About us</Link>
                                </div>
                                <div>
                                    <Link to='/home'>Products</Link>
                                </div>
                                <div>
                                    <Link to='/home'>Your Trolley</Link>
                                </div>
                                <div>
                                    <Link to='/home'>Contact us</Link>
                                </div>
                            </div>
                            <div className="col-lg-3 col-md-3">
                            </div>
                        </div>
                        <br/>
                        <div className="row justify-content-center">
                            <div className="col-lg-4 col-md-4">
                                <img className="contact-img" src={fb} alt="" width="40" height="40"/>
                                <img className="contact-img" src={email} alt="" width="40" height="40"/>
                                <img className="contact-img" src={whats} alt="" width="40" height="40"/>
                                <img className="contact-img" src={ph} alt="" width="40" height="40"/>
                            </div>
                        </div>
                    </div>
                </footer>
            </React.Fragment>

         );
    }
}
 
export default Footer;
